import './App.css';
import { Gallery } from './components/Gallery';
import {Home} from './pages/Home';
import { 
  BrowserRouter,
  Routes,
  Route
 } from 'react-router-dom';


function App() {
  return (   
      <BrowserRouter>
        <Routes>
            <Route path ="/" element={<Home/>}/>
            <Route path='/gallery' element={<Gallery/>}/>
        </Routes>
      </BrowserRouter>

  );
}
export default App;
